"use strict";(self.webpackChunkdev_points=self.webpackChunkdev_points||[]).push([[56],{3322:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"/2022/01/02/reqular-dev-resources","metadata":{"permalink":"/dev-points/2022/01/02/reqular-dev-resources","source":"@site/blog/2022-01-02-reqular-dev-resources.md","title":"Newsletters and regular resources for FrontEnd developer","description":"Intro","date":"2022-01-02T00:00:00.000Z","formattedDate":"January 2, 2022","tags":[{"label":"frontend","permalink":"/dev-points/tags/frontend"}],"readingTime":0.99,"truncated":false,"authors":[],"nextItem":{"title":"Welcome","permalink":"/dev-points/2022/01/01/welcome"}},"content":"## Intro\\n\\nThe resources presented in the article are primarily addressed to the _SPA-focused_ Front-End developers.<br/>\\nTo be honest, these are my favorite resources.\\nso my taste preferences could affect the choice\\n\\nThe information bellow is suitable for both `juniors` and `seniors`\\n\\n## \\"Baseline\\" pack\\n\\nHere i collect _required_ set of resources to follow\\n\\n:teacher: quick scan all articles from these subscriptions on a regular basis,\\nand study in detail 1-3 depending on free time.\\n\\n-   [JavaScript Weekly](https://javascriptweekly.com)\\n-   [CSS Weekly](https://css-weekly.com/)\\n-   [TypeScript Weekly](https://www.typescript-weekly.com)\\n-   [React Status](https://react.statuscode.com) [or your favorite `{framework}` Weekly]\\n-   [Web standards podcast](https://web-standards.ru/podcast/)\\n\\n## \\"Nice To Have\\" pack\\n\\n\x3c!--cSpell:words \u043a\u0440\u0430\u0441\u0438\u0432\u043e \u0441\u0434\u0435\u043b\u0430\u0439 --\x3e\\n\\n-   [\u0421\u0434\u0435\u043b\u0430\u0439 \u043c\u043d\u0435 \u043a\u0440\u0430\u0441\u0438\u0432\u043e podcast](https://front.sexy/)\\n-   [Dev tips by Umar Hansa](https://umaar.com/dev-tips/)\\n    -   not actively updated but study its archive to improve your chrome dev tools skills\\n\\n## \\"Development is my ~~live~~hobby\\" pack\\n\\n-   [Radio-T podcast](https://radio-t.com/)\\n-   [Webnya Telegram Channel](https://t.me/webnya)\\n\\n## Conclusion\\n\\nIn fact I am subscribed to a much more ~~useless~~ stuff<br/>\\nbut these ones I described above seem to cover the actual informational stream\\n\\n:bulb: Regular newsletters are only one part of your professional progress.<br/>\\nDo not forget about studying technologies and tools using courses(or self-study), books, take part in open source"},{"id":"/2022/01/01/welcome","metadata":{"permalink":"/dev-points/2022/01/01/welcome","source":"@site/blog/2022-01-01-welcome.md","title":"Welcome","description":"Hi I\u2019m Max (or Maxim), a developer from Belarus","date":"2022-01-01T00:00:00.000Z","formattedDate":"January 1, 2022","tags":[],"readingTime":0.41,"truncated":false,"authors":[],"prevItem":{"title":"Newsletters and regular resources for FrontEnd developer","permalink":"/dev-points/2022/01/02/reqular-dev-resources"}},"content":"Hi I\u2019m Max (or Maxim), a developer from Belarus\\n\\nWhile communicating with colleagues, we often find interesting solutions, tips, something useful and sharable.\\n\\nSometimes I just give advice in chats and notice that these answers later would be of great help to someone else\\n\\nI also tried to systematize my knowledge and see how it will look\\n\\nin the end, I created this project with blogs, notes to collect all above finds...\\n\\nAt worst, I learn how to mange [docusaurus](https://docusaurus.io/) sites :sunglasses:"}]}')}}]);